INSERT INTO `news` VALUES ('72', '3分钟前', '天津市新增确诊病例3例，新增出院病例2例', '2020年2月18日0－24时，天津市报告新型冠状病毒肺炎新增确诊病例3例，新增危重型病例0例，新增重型病例0例，新增死亡病例0例，新增出院病例2例。其中：新增确诊病例中宝坻区3例。', '天津卫健委', 'http://wsjk.tj.gov.cn/art/2020/2/19/art_87_71167.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('73', '27分钟前', '陕西新增2例新冠肺炎，确诊病例累计242例', '截至2月19日9时，陕西新增2例新冠肺炎确诊病例，新增疑似病例19例。新增确诊病例中，西安市1例、汉中市1例。陕西累计报告新冠肺炎确诊病例242例（89例治愈出院）。', '陕西卫健委', 'http://sxwjw.shaanxi.gov.cn/art/2020/2/19/art_9_68128.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('74', '31分钟前', '浙江省新增确诊病例1例，新增出院病例30例', '2020年2月18日0-24时，浙江省报告新型冠状病毒肺炎新增确诊病例1例，新增出院病例30例。截至2月18日24时，浙江省累计报告新型冠状病毒肺炎确诊病例1173例，现有重症病例63例（其中危重22例），累计出院544例。', '浙江卫健委', 'https://www.zjwjw.gov.cn/art/2020/2/19/art_1202101_41943016.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('75', '33分钟前', '上海无新增确诊病例', '2020年2月18日12—24时，上海市排除新型冠状病毒肺炎疑似病例26例；无新增确诊病例。截至2月18日24时，上海市已累计排除疑似病例1880例，发现确诊病例333例。\n                        ', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200219/645a012cb78a4c109ace96293ecd0e2e.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('76', '33分钟前', '江西省报新增确诊病例1例，新增治愈52例  ', '2020年2月18日0-24时，江西省报告新型冠状病毒肺炎新增确诊病例1例，新增治愈出院病例52例。截至2月18日24时，江西省现有住院确诊病例571例。累计报告新型冠状病毒肺炎确诊病例934例，其中治愈出院病例362例，死亡病例1例。', '江西卫健委', 'http://hc.jiangxi.gov.cn/doc/2020/02/19/139117.shtml', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('77', '34分钟前', '宁夏新增确诊病例1例，新增出院病例7例', '2020年2月18日0-24时，全区新增新型冠状病毒肺炎确诊病例1例（同心县1例），新增出院病例7例。截至2月18日24时，全区现有确诊病例29例，累计出院病例42例；现有疑似病例25例（较17日减少2例）。', '宁夏卫健委', 'http://wsjkw.nx.gov.cn/info/1262/14472.htm', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('78', '35分钟前', '广东新增确诊病例3例，新增出院41例', '截至2月18日24时，全省累计报告新冠肺炎确诊病例1331例。18日当天全省新增确诊病例3例，为惠州市3例。新增出院41例，累计出院571例。新增出院病例中，8例为重型病例治愈出院，其他为普通型或者轻型治愈出院。新增死亡病例1例，为珠海市1例，累计死亡5例。另有疑似病例1例。有2543 名密切接触者正在接受医学观察。', '广东卫健委', 'http://wsjkw.gd.gov.cn/xxgzbdfk/yqtb/content/post_2900972.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('79', '36分钟前', '内蒙古自治区新增确诊病例2例，新增出院病例1例', '2020年2月18日9时至19日8时，内蒙古自治区报告新增新冠肺炎确诊病例2例，新增疑似病例3例，新增出院病例1例，排除疑似病例1例。', '内蒙古卫健委', 'http://wjw.nmg.gov.cn/doc/2020/02/19/292632.shtml', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('80', '38分钟前', ' 北京市新增6例新冠肺炎确诊病例，23例治愈出院 ', '2月18日0时至24时，本市新增6例新冠肺炎确诊病例，本市累计确诊病例393例。其中出院145例，死亡4例。', '北京卫健委', 'http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200219_1657553.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('81', '44分钟前', '江苏新增2例新型冠状病毒肺炎确诊病例', '2020年2月18日0-24时，江苏省报告新型冠状病毒肺炎新增确诊病例2例，均为普通型病例。新增出院病例33例。', '江苏卫健委', 'http://wjw.jiangsu.gov.cn/art/2020/2/19/art_7290_8976979.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('82', '44分钟前', '安徽省新增确诊4例，新增治愈出院病例68例', '2020年2月18日0-24时，安徽省报告新增确诊病例4例，无新增疑似病例，新增治愈出院病例68例。累计报告确诊病例986例，累计治愈出院病例361例，累计死亡病例6例，累计医学观察密切接触者24600人，尚在医学观察3602人。', '安徽卫健委', 'http://wjw.ah.gov.cn/news_details_55120.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('83', '45分钟前', '新疆（含兵团）新增确诊0例，新增死亡0例，新增治愈出2例', '2020年2月18日0-24时，新疆（含兵团）报告新型冠状病毒肺炎新增确诊病例0例，新增死亡病例0例，新增治愈出院病例2例。截至2月18日24时，新疆（含兵团）累计报告新型冠状病毒肺炎确诊病例76例（新疆维吾尔自治区52例、新疆生产建设兵团24例），累计死亡病例1例，累计治愈出院病例14例。', '新疆卫健委', 'http://www.xjhfpc.gov.cn/info/2070/18750.htm', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('84', '45分钟前', '辽宁省无新增确诊病例，新增12例治愈出院病例', '2020年2月18日0时至24时，辽宁省无新增新型冠状病毒肺炎确诊病例。新增12例治愈出院病例，其中大连市4例、本溪市2例、阜新市3例、辽阳市1例、葫芦岛市2例。全省累计报告新型冠状病毒肺炎确诊病例121例，治愈出院55例，死亡1例。     ', '辽宁卫健委', 'http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200219_3744182.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('85', '48分钟前', '贵州省无新增确诊病例,新增治愈出院病例3例', '2020年2月18日12—24时，全省新型冠状病毒肺炎无新增确诊病例,新增治愈出院病例3例（遵义市3例）。截至2月18日24时，全省累计报告新型冠状病毒肺炎病例146例，治愈出院69例，轻症及普通型67例，重症4例，危重症4例，死亡2例。\n         ', '贵州卫健委', 'http://www.gzhfpc.gov.cn/ztzl_500663/xxgzbdgrdfyyqfk/yqdt/202002/t20200219_50042146.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('86', '58分钟前', '四川新增确诊病例6例，新增治愈14例', '2月18日0-24时，我省新型冠状病毒肺炎新增确诊病例6例，新增治愈出院病例14例，新增疑似病例40例，无新增死亡病例。截至2月19日0时，我省累计报告新型冠状病毒肺炎确诊病例514例，涉及21个市（州）。现有疫情县（市、区）98个（增加龙马潭区1个，减少九寨沟县、九龙县、新龙县、冕宁县等4个）。', '四川卫健委', 'http://wsjkw.sc.gov.cn/scwsjkw/gzbd01/2020/2/19/6634b956576942cc91356ceec1a1f692.shtml', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('87', '58分钟前', '青海省无新增确诊病例和疑似病例', '2020年2月18日0-24时，青海省报告新型冠状病毒肺炎新增确诊病例0例，新增重症病例0例，新增死亡病例0例，新增出院病例2例。当日无新增确诊病例和疑似病例。截至2月18日24时，青海省累计报告新型冠状病毒肺炎确诊病例18例，其中：重症病例1例，死亡病例0例，出院病例15例。', '青海卫健委', 'https://wsjkw.qinghai.gov.cn/ztbd/yqjk/yqtb/2020/02/19/1582072145467.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('88', '11小时前', '甘肃无新增新型冠状病毒肺炎确诊病例累计91例', '2月17日20时至2月18日20时，甘肃省无新增新型冠状病毒肺炎确诊病例。新增出院4例。截至2月18日20时，甘肃累计报告新型冠状病毒肺炎确诊病例91例。累计治愈出院62例，累计死亡病例2例。\n				', '甘肃卫健委', 'http://wsjk.gansu.gov.cn/single/11218/84225.html', '2020-02-19 09:40:16');
INSERT INTO `news` VALUES ('140', '1小时前', '湖北3月部分考试推迟', '湖北省推迟原定于3月份进行的以下报名及考试组织工作：1.2月20日至3月4日高等教育自学考试2020年4月份考试的报名;2.3月14日至15日高等教育自学考试计算机化考试；3.3月19日至22日湖北省英语口语等级（三级）考试；4.3月21日湖北省成人学士学位外语考试；新的报名、考试时间将根据情况另行通知。教育部考试中心已就3月份有关全国性考试作出推迟安排，湖北省遵照执行。', '人民网', 'http://m.weibo.cn/2286908003/4473646225213739', '2020-02-19 13:03:55');
INSERT INTO `news` VALUES ('141', '2小时前', '江西省疫情防控从“胶着对垒”转向“持续向好”            ', '　2月18日，江西省疫情防控应急指挥部综合组组长、省卫生健康委副主任龚建平在省新冠肺炎疫情防控工作新闻发布会（第十一场）上，通报了江西省最新疫情防治情况。\n', '江西卫健委', 'http://hc.jiangxi.gov.cn/doc/2020/02/19/139133.shtml', '2020-02-19 13:03:55');
INSERT INTO `news` VALUES ('142', '2小时前', '公安部要求严禁过度执法粗暴执法', '针对当前个别地方在疫情防控工作中存在的简单粗暴等问题，18日，国务委员、公安部党委书记、部长赵克志对公安民警依法开展疫情防控工作提出明确要求。他强调，要坚持严格规范公正文明执法，严禁过度执法、粗暴执法。\n', '人民日报', 'http://m.weibo.cn/2803301701/4473627565411919', '2020-02-19 13:03:55');
INSERT INTO `news` VALUES ('145', '5小时前', '钻石公主号2名新冠肺炎感染者死亡', '据日本广播协会电视台20日报道，2名在“钻石公主”号邮轮上感染冠肺炎的患者死亡。这首次出现在“钻石公主”号邮轮感染新冠肺炎后死亡的病例。截至目前，日本国内新冠肺炎死亡病例增至3例。\n', '人民日报', 'http://m.weibo.cn/2803301701/4473995094751309', '2020-02-20 17:19:20');
INSERT INTO `news` VALUES ('146', '6小时前', '全国13地新增病例为0', '2月19日0-24时，上海、江苏、辽宁、福建、山西、贵州、宁夏、云南、青海、新疆、西藏报告无新增新冠肺炎确诊病例；19日8时—20日8时，内蒙古报告无新增确诊病例；18日20时至19日20时，甘肃报告无新增确诊病例。且其余省区市新增确诊病例均为个位数。\n', '人民日报', 'http://m.weibo.cn/2803301701/4473991953264899', '2020-02-20 17:19:20');
INSERT INTO `news` VALUES ('147', '6小时前', '湖北以外新增病例16连降', '据国家卫健委数据统计，2月19日0—24时，全国除湖北以外地区新增确诊病例45例，连续第16日呈下降态势。前几日这一数据分别为：890例（3日）、731例（4日）、707例（5日)、696例（6日）、558例（7日）、509例（8日）、444例（9日）、381例（10日）、377例（11日）、312例（12日）、267例（13日）、221例（14日）、166例（15日）、115例（16日），79例（17日），56例（18日）。\n', '人民网', 'http://m.weibo.cn/2286908003/4473983589954353', '2020-02-20 17:19:20');
INSERT INTO `news` VALUES ('148', '6小时前', '全国新增394例新冠肺炎，累计确诊新冠肺炎74576例', '2月19日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例394例，新增死亡病例114例，新增疑似病例1277例。截至2月19日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例56303例，累计治愈出院病例16155例，累计死亡病例2118例，累计报告确诊病例74576例，现有疑似病例4922例。累计追踪到密切接触者589163人，尚在医学观察的密切接触者126363人。', '人民日报', 'http://m.weibo.cn/2803301701/4473982336318492', '2020-02-20 17:19:20');
INSERT INTO `news` VALUES ('149', '6小时前', '韩国累计确诊82例新冠肺炎', '据韩国卫生部门消息：截至当地时间20日上午9时，韩国新型冠状病毒感染者人数已达82人。新增的31例确诊患者中，有30人来自韩国南部的大邱市及周边的庆尚北道地区。经初步流行病学调查，18日该地区出现首例确诊病例，此后新增的确诊感染者大部分都与其有关联。', '央视新闻', 'http://m.weibo.cn/2656274875/4473980846903958', '2020-02-20 17:19:20');
INSERT INTO `news` VALUES ('170', '1小时前', '疑似或确诊孕产妇产检定点医院', '2月20日，国家卫健委公布各省（区、市）新型冠状病毒感染疑似或确诊孕产妇产检和住院分娩定点医院。\n', '人民日报', 'http://m.weibo.cn/2803301701/4474110862123362', '2020-02-20 20:43:23');
INSERT INTO `news` VALUES ('171', '1小时前', '湖北省内企业不早于3月10日24时前复工', '湖北发布通告：①省内各类企业先按不早于3月10日24时前复工。涉及保障疫情防控必需、公共事业运行必需、群众生活必需及其他涉及重要国计民生的相关企业除外 ②湖北省内学校延期开学，具体开学时间将经评估后公布③广大居民尽量减少出行，不参加聚集性活动。', '央视新闻', 'http://m.weibo.cn/2656274875/4474101017939775', '2020-02-20 20:43:23');
INSERT INTO `news` VALUES ('172', '2小时前', '29名外国公民在华确诊', '截至19日18时，外国公民在华确诊患新冠肺炎的病例有29例，其中在湖北是10例。其中，18人已经治愈出院，2例死亡，9人正在接受隔离治疗。中国政府高度重视在华外国公民的生命和安全，对在华感染新冠肺炎的外国公民，我们会一视同仁进行及时有效的救治。', '央视新闻', 'http://m.weibo.cn/2656274875/4474096693876136', '2020-02-20 20:43:23');
INSERT INTO `news` VALUES ('173', '3小时前', '贵州省新增治愈出院病例1例', '2020年2月20日0—12时，全省新型冠状病毒肺炎无新增确诊病例,新增治愈出院病例1例，其中：遵义市1例。', '贵州卫健委', 'http://www.gzhfpc.gov.cn/ztzl_500663/xxgzbdgrdfyyqfk/yqdt/202002/t20200220_50351377.html', '2020-02-20 20:43:23');
INSERT INTO `news` VALUES ('174', '6小时前', '上海新增1例新型冠状病毒肺炎确诊病例', '2020年2月20日0—12时，上海市排除新型冠状病毒肺炎疑似病例31例；新增治愈出院13例，其中1例为7月龄婴儿；新增确诊病例1例，为确诊病例密切接触者。 \n                        ', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200220/43a5c5294ea84850bd1b4b3a4b866b63.html', '2020-02-20 20:43:23');
INSERT INTO `news` VALUES ('180', '1小时前', '辽宁应急响应调整为三级', '据辽宁省卫健委网站，根据国家有关法律法规规定和辽宁省新冠肺炎疫情发展形势，自2020年2月22日9时起，将辽宁省新冠肺炎疫情防控应急响应级别由一级应急响应调整为省级三级应急响应。\n', '人民日报', 'http://m.weibo.cn/2803301701/4474724476174964', '2020-02-22 13:31:52');
INSERT INTO `news` VALUES ('181', '2小时前', '口罩日产量可达到上亿只', '口罩是医务人员抗击疫情的武器，是保护群众健康的盾牌。21日，国务院总理李克强到北京海淀考察医疗防控物资生产供应保障情况。有关部门负责人说，较短时间内实现了全国医用防护服、口罩等产能产量成倍增长。未来还会有大批新的产能投产，#口罩日产量可达到上亿只#。多措并举增加医疗防控物资生产供应  支持疫情防控防治保障有序复工复产 \n', '人民网', 'http://m.weibo.cn/2286908003/4474718755387827', '2020-02-22 13:31:52');
INSERT INTO `news` VALUES ('182', '3小时前', '上海无新增确诊病例，新增死亡1例', ' 2020年2月21日12—24时，上海市排除新型冠状病毒肺炎疑似病例35例；无新增确诊病例；新增死亡1例。\n                        ', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200222/0a10b6df11c845368af2d627d9551ed1.html', '2020-02-22 13:31:52');
INSERT INTO `news` VALUES ('183', '3小时前', ' 北京市新增3例确诊病例，新增9例治愈出院病例', '本市新增3例新冠肺炎确诊病例，新增疑似病例26例，现有疑似病例104例，治愈出院9例。   截至2月21日24时，本市累计确诊病例399例。\n                ', '北京卫健委', 'http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200222_1666236.html', '2020-02-22 13:31:52');
INSERT INTO `news` VALUES ('184', '3小时前', '韩国新增142例新冠肺炎病例，累计确诊346例新冠肺炎', '韩国中央防疫对策本部22日通报，截至当天上午9时，韩国新增142例新冠肺炎确诊病例，累计确诊病例达346例。\n', '人民日报', 'http://m.weibo.cn/2803301701/4474695493908425', '2020-02-22 13:31:52');
INSERT INTO `news` VALUES ('195', '17分钟前', '福建无新增确诊，新增治愈15例', '2月22日0—24时，福建省报告新增新型冠状病毒肺炎确诊病例0例，新增治愈出院病例15例，截至2月22日24时，福建省累计报告新型冠状病毒肺炎确诊病例293例（危重型6例、重型3例，死亡病例1例）。目前，确诊、疑似病例的密切接触者已解除医学观察9392人，尚有1474人正在接受医学观察。\n                ', '福建卫健委', 'http://wjw.fujian.gov.cn/ztzl/gzbufk/yqtb/202002/t20200223_5201238.htm', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('196', '25分钟前', '河南新增确诊1例，新增治愈59例', '2020年2月22日0-24时，河南省新增新型冠状病毒肺炎确诊病例1例,新增出院病例59例。截至2月22日24时，全省累计报告新型冠状病毒肺炎确诊病例1271例，现有重症病例17例，现有危重病例21例，累计死亡病例19例，累计出院病例861例。目前累计追踪到密切接触者38909人，2月22日已解除观察6419人，共有5289人正在接受医学观察。\n ', '河南卫健委', 'http://www.hnwsjsw.gov.cn/contents/858/48658.shtml', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('197', '40分钟前', '吉林无新增确诊，新增治愈6例', '2月22日0-24时，全省无新增确诊病例。新增治愈出院6例，截至2月22日24时，全省累计报告确诊病例91例，累计治愈出院52例，死亡1例，现在院隔离治疗确诊病例38例。上述确诊病例的密切接触者3933人，已解除医学观察3610人，正在指定地点隔离或居家隔离医学观察323人。', '吉林卫健委', 'http://www.jl.gov.cn/szfzt/jlzxd/yqtb/202002/t20200223_6858067.html', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('198', '42分钟前', '广西无新增确诊，新增治愈5例', '2月22日0-24时，我区无新增新型冠状病毒肺炎确诊病例；新增疑似病例12例；新增治愈出院病例5例（南宁市3例、玉林市2例）；无新增死亡病例。目前全区累计报告确诊病例249例，累计出院病例104例，累计死亡病例2例，本日追踪到密切接触者34人，现有1274人正在接受医学观察。   ', '广西卫健委', 'http://wsjkw.gxzf.gov.cn/zhuantiqu/ncov/ncovyqtb/2020/0223/69175.html', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('199', '52分钟前', '辽宁无新增确诊，新增2例治愈', '2020年2月22日0时至24时，辽宁省无新增新型冠状病毒肺炎确诊病例。新增2例治愈出院病例，全省累计报告新型冠状病毒肺炎确诊病例121例，治愈出院68例，死亡1例。目前累计追踪到密切接触者2717人，已解除医学观察2420人，现有297人正在接受医学观察。\n', '辽宁卫健委', 'http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200223_3747260.html', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('200', '55分钟前', '河北新增2例，累计311例', '2020年2月22日0—24时，河北省报告新型冠状病毒肺炎新增确诊病例2例，新增治愈出院病例20例，截至2月22日24时，河北省累计报告确诊病例311例，其中在院治疗101例，现有重症病例9例，累计治愈出院204例，死亡6例。目前累计追踪到密切接触者10547人，当日解除隔离医学观察88人，现有749人正在接受隔离医学观察。', '河北卫健委', 'http://wsjkw.hebei.gov.cn/content/content_3714/399457.jhtml', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('201', '1小时前', '内蒙古无新增确诊，新增治愈4例', '2020年2月22日7时至23日7时，内蒙古自治区报告无新增新冠肺炎确诊病例，无新增疑似病例，新增出院病例4例，排除疑似病例1例。截至2月23日7时，内蒙古自治区累计报告新冠肺炎确诊病例75例, 现存确诊病例49例，出院病例26例，重症病例3例，危重病例4例。目前，尚在接受医学观察的密切接触者408人。当日解除医学观察108人。\n\n                    ', '内蒙古卫健委', 'http://wjw.nmg.gov.cn/doc/2020/02/23/293794.shtml', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('202', '1小时前', '意大利累计确诊76例新冠肺炎', '当地时间22日，意大利累计确诊76例新冠病毒肺炎感染病例， 1人治愈出院，2人死亡，意大利成欧洲疫情最严重国家。拉齐奥大区卫生局22日在新闻发布会上宣布，罗马传染病医院确诊的中国夫妇病情持续好转。为对抗疫情，意大利多地陆续提升防控措施，取消或暂停文体活动。', '人民日报', 'http://m.weibo.cn/2803301701/4475031620543692', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('203', '1小时前', '重庆新增1例确诊，新增12治愈', '2020年2月22日0—24时，重庆市报告新冠肺炎新增确诊病例1例，新增治愈出院病例12例。截至2月22日24时，重庆市现有在院确诊病例239例（其中重型病例24例、危重型病例10例），累计死亡病例6例，累计治愈出院病例328例，累计报告确诊病例573例。累计追踪到密切接触者23063人，已解除医学观察21854人，尚有1209人正在接受医学观察。', '重庆卫健委', 'http://wsjkw.cq.gov.cn/yqxxyqtb/20200223/255839.html', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('204', '1小时前', '湖北新增630例新冠肺炎，累计64084例', '2020年2月22日0—24时，全省新增新冠肺炎确诊病例630例，截至2020年2月22日24时，湖北省累计报告新冠肺炎确诊病例64084例，全省累计病亡2346例，目前仍在院治疗40127例，累计追踪密切接触者234217人，尚在接受医学观察62787人。\n', '人民日报', 'http://m.weibo.cn/2803301701/4475027368111080', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('205', '1天前', '山东新增4例，累计754例', ' 2020年2月22日12-24时，山东省报告新增新型冠状病毒肺炎确诊病例4例，累计确诊病例754例(含重症病例5例，危重症病例11例，治愈出院311例，死亡病例4例);新增疑似病例2例，现有疑似病例18例。截至目前，追踪到密切接触者16562人，已解除医学观察14638人，诊断为疑似或确诊病例291例，尚有1633人正在接受医学观察。', '山东卫健委', 'http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202002/t20200223_2582619.html', '2020-02-23 09:02:48');
INSERT INTO `news` VALUES ('206', '2小时前', '菲律宾明日从钻石公主号撤侨', '菲律宾卫生部称，菲政府将于25日从“钻石公主”号撤侨，并安排包机将侨民接回。“钻石公主”号上共有538名菲律宾公民，有意向回国的400人左右，具体撤离人数要根据25日的检测结果确定，撤回人员将进行14天隔离。截至24日，菲律宾累计确诊新冠肺炎59例，其中2人治愈出院。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4475499332344791', '2020-02-24 17:18:19');
INSERT INTO `news` VALUES ('207', '2小时前', '上海排除疑似病例22例', '2020年2月24日0—12时，上海市排除新型冠状病毒肺炎疑似病例22例；新增治愈出院12例（其中1例曾为重症患者，经多学科专家团队积极救治后治愈）；无新增确诊病例。 截至2月24日12时，上海市已累计排除疑似病例2184例，发现确诊病例335例。\n          \n           \n       ', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200224/efaced58510f4e8f8e24cc5e763308ae.html', '2020-02-24 17:18:19');
INSERT INTO `news` VALUES ('208', '3小时前', '韩政府已将新冠肺炎疫情预警上调至最高级别', '中国驻韩使馆今天发布公告，公告称，韩政府已将新冠肺炎疫情预警上调至最高级别“严重”，并将大邱和庆尚北道地区划为“特别管控区”。韩政府将加大应对力度，可视情采取包括下令关闭学校、禁止集会等措施。', '央视新闻', 'http://m.weibo.cn/2656274875/4475476586273767', '2020-02-24 17:18:19');
INSERT INTO `news` VALUES ('209', '4小时前', '云南省无新增确诊，新增治愈9例，治愈出院124例', ' 2月24日0时至12时，云南省无新增确诊病例，新增治愈出院病例9例（昆明市4例，玉溪市3例，文山州、大理州各1例）。截至2月24日12时，全省累计确诊病例174例，治愈出院124例，死亡2例，现有确诊病例48例，其中重症1例。现有疑似病例25例。', '云南卫健委', 'http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158251939613396359', '2020-02-24 17:18:19');
INSERT INTO `news` VALUES ('210', '5小时前', '全国24地新增病例为0', '23日0-24时，北京、天津、河北、山西、辽宁、黑龙江、上海、江苏、浙江、安徽、福建、江西、河南、湖南、海南、贵州、云南、西藏、青海、宁夏、新疆（含兵团）新增确诊病例为0；22日8时-23日8时，陕西新增确诊病例为0；21日20时-22日20时，甘肃新增确诊病例为0；22日7时-23日7时，内蒙古新增确诊病例为0。\n', '人民网', 'http://m.weibo.cn/2286908003/4475452309400201', '2020-02-24 17:18:19');
INSERT INTO `news` VALUES ('211', '8小时前', '四川新增2例确诊，15例治愈', ' 2月24日0-24时，我省新型冠状病毒肺炎新增确诊病例2例，新增治愈出院病例15例，新增疑似病例7例，无新增死亡病例。 截至2月25日0时，我省累计报告新型冠状病毒肺炎确诊病例529例，涉及21个市（州）。 529名确诊患者中，正在住院隔离治疗248人（其中危重18人），已治愈出院278人，死亡3人', '四川卫健委', 'http://wsjkw.sc.gov.cn/scwsjkw/gzbd01/2020/2/25/efa48b3d2308470fac6f3bbfc98151bf.shtml', '2020-02-25 19:34:53');
INSERT INTO `news` VALUES ('212', '9小时前', '北京市新增1例确诊，17例治愈出院 ', ' 2月24日0时至24时，北京市新增1例新冠肺炎确诊病例。该病例有外省市接触史，已送至定点医疗机构进行救治。新增疑似病例18例，现有疑似病例73例。新增密切接触者3例，累计确定密切接触者2487例，其中1748例已解除医学观察。 截至2月24日24时,北京市累计确诊病例400例。出院215例，死亡4例，危重型13例。', '北京卫健委', 'http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200225_1668175.html', '2020-02-25 19:34:53');
INSERT INTO `news` VALUES ('213', '9小时前', '河南省无新增确诊，累计1271例', '2020年2月24日0-24时，河南省无新增新型冠状病毒肺炎确诊病例,新增出院病例59例。截至2月24日24时，全省累计报告新型冠状病毒肺炎确诊病例1271例，现有重症病例17例，现有危重病例14例，累计死亡病例19例，累计出院病例989例。目前累计追踪到密切接触者39098人，2月24日已解除观察737人，共有3734人正在接受医学观察。', '河南卫健委', 'http://www.hnwsjsw.gov.cn/contents/858/48699.shtml', '2020-02-25 19:34:53');
INSERT INTO `news` VALUES ('214', '9小时前', '韩国新增60例新冠肺炎，累计确诊增至893例', '韩国中央防疫对策本部25日通报，截至当地时间当天上午9时，韩国较前一天下午4时新增60例新冠肺炎确诊病例，累计确诊病例达893例。', '人民日报', 'http://m.weibo.cn/2803301701/4475780820178638', '2020-02-25 19:34:53');
INSERT INTO `news` VALUES ('215', '10小时前', '青海无新增确诊，累计确诊已全部治愈出院', ' 2020年2月24日0-24时，当日青海省无新型冠状病毒肺炎新增确诊病例和疑似病例。截至2月24日24时，青海省累计报告新型冠状病毒肺炎确诊病例18例（其中西宁市15例，海北州3例），已全部治愈出院。目前累计追踪到密切接触者437人，已全部解除医学观察。\n\n		\n		', '青海卫健委', 'https://wsjkw.qinghai.gov.cn/ztbd/yqjk/yqtb/2020/02/25/1582590912018.html', '2020-02-25 19:34:53');
INSERT INTO `news` VALUES ('216', '2小时前', '泰国累计确诊新冠肺炎达40例', '据央视，26日，泰国卫生部在每日新冠肺炎疫情的发布会上表示，泰国新增新冠肺炎确诊病例3例。这3例为同一家庭，其中2人为一对从日本旅行归来的夫妇，另1人为该夫妇8岁的外孙，未有出国旅行史。截止到当地时间26日上午11时，泰国累计确诊病例40例。 ', '人民日报', 'http://m.weibo.cn/2803301701/4476215353974436', '2020-02-26 16:51:36');
INSERT INTO `news` VALUES ('217', '3小时前', '截至2月26日12时云南省新增治愈出院病例15例', '2月26日0时至12时，无新增确诊病例，新增治愈出院病例15例（昆明市12例，德宏州2例，保山市1例）。截至2月26日12时，全省累计确诊病例174例，治愈出院144例，死亡2例，现有确诊病例28例，其中重症1例。', '云南卫健委', 'http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158269149817009450', '2020-02-26 16:51:36');
INSERT INTO `news` VALUES ('218', '5小时前', '全国49位公安民警辅警因公牺牲', '公安部副部长杜航伟表示，一个多月来，全国公安民警和辅警有49人因公牺牲，他们以实际行动树立了新时代人民公安为人民的新形象，其中就有同志在打击犯罪中光荣牺牲。 \n', '人民网', 'http://m.weibo.cn/2286908003/4476164586849901', '2020-02-26 16:51:36');
INSERT INTO `news` VALUES ('219', '6小时前', '湖北以外新增病例5例，新增病例连续两天个位数', '据国家卫健委数据统计，2月25日0—24时，湖北以外30个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例5例。\n', '人民网', 'http://m.weibo.cn/2286908003/4476154431482323', '2020-02-26 16:51:36');
INSERT INTO `news` VALUES ('220', '6小时前', '31省区市新增406确诊病例，累计报告新冠肺炎78064例', '国家卫健委，2月25日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例406例，新增死亡病例52例（湖北52例），新增疑似病例439例。当日新增治愈出院病例2422例，解除医学观察的密切接触者14573人，重症病例减少374例。截至2月25日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例45604例（其中重症病例8752例），累计治愈出院病例29745例，累计死亡病例2715例，累计报告确诊病例78064例，现有疑似病例2491例。', '人民网', 'http://m.weibo.cn/2286908003/4476153148746820', '2020-02-26 16:51:36');
INSERT INTO `news` VALUES ('221', '2小时前', '韩国累计确诊1766例', '韩国中央防疫对策本部27日通报，截至当地时间当天下午4时，韩国较当天上午9时新增171例新冠肺炎确诊病例，累计确诊病例达1766例。与前一天下午4时相比，一天内增加病例505例。\n', '人民日报', 'http://m.weibo.cn/2803301701/4476619236614643', '2020-02-27 19:07:21');
INSERT INTO `news` VALUES ('222', '9小时前', '上海新增1例确诊病例', '2020年2月26日12—24时，上海市排除新型冠状病毒肺炎疑似病例22例，新增确诊病例1例。 截至2月26日24时，上海市已累计排除疑似病例2285例，发现确诊病例337例。目前，50例病情平稳，9例病情危重，3例重症，272例治愈出院，3例死亡。尚有74例疑似病例正在排查中。\n                        ', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200227/2ac3c9b106fc4f45a6aafbad113b9ba6.html', '2020-02-27 19:07:21');
INSERT INTO `news` VALUES ('223', '9小时前', '湖北新增409例新冠肺炎，累计65596例', '湖北新增确诊病例409例（武汉383例），新增治愈出院病例2288例（武汉1535例），新增死亡病例26例（武汉19例），现有确诊病例39755例（武汉32392例），其中重症病例7984例（武汉7049例）。累计治愈出院病例23200例（武汉13328例），累计死亡病例2641例（武汉2104例），累计确诊病例65596例（武汉47824例）。\n', '人民日报', 'http://m.weibo.cn/2803301701/4476507977823152', '2020-02-27 19:07:21');
INSERT INTO `news` VALUES ('224', '9小时前', '全国新增433例新冠肺炎，累计确诊78497例', '2月26日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例433例，新增死亡病例29例（湖北26例，北京、黑龙江、河南各1例），新增疑似病例508例。  当日新增治愈出院病例2750例，解除医学观察的密切接触者12823人，重症病例减少406例。 ', '央视新闻', 'http://m.weibo.cn/2656274875/4476507625366900', '2020-02-27 19:07:21');
INSERT INTO `news` VALUES ('225', '9小时前', '韩国新增新冠肺炎确诊病例334例，累计1595例', '韩国中央防疫对策本部27日通报，截至当地时间27日上午9时，韩国较前一天下午4时新增334例新冠肺炎确诊病例，累计确诊病例达1595例。韩国中央防疫对策本部本部长郑银敬26日在记者会上表示，韩国境内感染新冠肺炎的致死率为1%左右，死亡病例主要集中在高龄或有基础疾病的患者。', '人民日报', 'http://m.weibo.cn/2803301701/4476505322957126', '2020-02-27 19:07:21');
INSERT INTO `news` VALUES ('226', '4小时前', '日本累计确诊新冠肺炎931例', '【#日本累计确诊新冠肺炎931例#】截至日本当地时间2月28日17时25分，日本累计确诊新冠肺炎病例931例，因新冠肺炎死亡累计9人。据共同社报道，28日，北海道新确诊12名新冠肺炎患者。当天，家住和歌山县的一名70多岁的新冠肺炎男性患者死亡。（刘军国） \n', '人民日报', 'http://m.weibo.cn/2803301701/4476979053214661', '2020-02-28 21:26:31');
INSERT INTO `news` VALUES ('227', '4小时前', '韩国新冠肺炎累计确诊2337例', '【#韩国新冠肺炎累计确诊2337例#，#韩国新冠肺炎一天增加571例#】人民日报记者马菲消息，韩国中央防疫对策本部28日通报，截至当天下午4时，韩国较当天上午9时新增新冠肺炎确诊病例315例，累计确诊病例达2337例。与前一天下午4时相比，一天内增加病例571例。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4476973646845856', '2020-02-28 21:26:31');
INSERT INTO `news` VALUES ('228', '6小时前', '致敬！内蒙古殉职民警何建华 用生命战疫情', '【致敬！内蒙古殉职民警何建华 用生命战疫情】在战“疫”一线，内蒙古突泉县民警何建华的生命永远定格在52岁。大年初二，得知疫情形势严峻，他主动请缨值守客运站，登记信息、测体温，忙得顾不上喝水。从警26年，他每天走访巡查，3年骑坏2台电动车，调解民事纠纷2600多起，荣记个人三等功1次、嘉奖6次。 央视新闻的微博视频\n', '央视新闻', 'http://m.weibo.cn/2656274875/4476939261400762', '2020-02-28 21:26:31');
INSERT INTO `news` VALUES ('229', '7小时前', '新西兰出现首例新冠肺炎确诊病例', '【#新西兰出现首例新冠肺炎确诊病例#】#新冠肺炎最新动态# 据新西兰总理阿德恩确认，一位乘客于26日从伊朗搭乘飞机入境新西兰，成为新西兰首例新冠肺炎确诊病例。该名乘客60多岁，乘坐航班为EK450 ，从伊朗首都德黑兰经印尼转机抵达新西兰；目前该患者在奥克兰医院接受治疗，其他密切接触者已被隔离并接受病毒检测。（央视）\n', '人民网', 'http://m.weibo.cn/2286908003/4476937655340483', '2020-02-28 21:26:31');
INSERT INTO `news` VALUES ('230', '8小时前', '巴西确诊首例新冠肺炎病例', '#全球抗疫第一线#【#巴西确诊首例新冠肺炎病例#】当地时间26日，巴西一名61岁男子被确诊为拉美国家首个新冠肺炎病例。因其在狂欢节期间接触人数较多，截至当地时间27日17时，巴西新冠病毒肺炎疑似病例增至132例。巴西、哥伦比亚、阿根廷等拉美多国政府均表示将出台措施，加强应对。（总台记者陈昱） \n', '央视新闻', 'http://m.weibo.cn/2656274875/4476915891013591', '2020-02-28 21:26:31');
INSERT INTO `news` VALUES ('231', '5分钟前', '挪威新冠肺炎患者增至7例', '当地时间2月29日，挪威电视台报道，挪威首都奥斯陆的乌勒沃医院再次出现一例确诊病例。该员工与之前被感染的员工有过密切接触。最令人担忧的是，该医院首个出现症状的员工在周一、周二两天接触过上百人。目前挪威共有7人确诊新冠肺炎。', '央视新闻', 'http://m.weibo.cn/2656274875/4477379734575871', '2020-02-29 19:43:38');
INSERT INTO `news` VALUES ('232', '48分钟前', '德国累计确诊66例新冠肺炎', '根据德国疾病防控机构罗伯特·科赫研究所最新公布的数据显示，截止当地时间2月29日上午10时，德国共确诊66例新冠病毒肺炎感染病例。综合德国媒体报道，截止目前，在德国北莱茵-威斯特法伦州另有约2000人因曾与确诊患者有接触被居家隔离。', '人民日报', 'http://m.weibo.cn/2803301701/4477369022729347', '2020-02-29 19:43:38');
INSERT INTO `news` VALUES ('233', '53分钟前', '伊朗新增新冠肺炎感染者205例，累计593例', '据美联社报道， 伊朗卫生部发言人29日表示，伊朗新增新冠肺炎感染者205例，累计593例。新增死亡病例9例，累计43例。报道称已有123名患者治愈。', '人民日报', 'http://m.weibo.cn/2803301701/4477367676254654', '2020-02-29 19:43:38');
INSERT INTO `news` VALUES ('234', '1小时前', '日本新冠肺炎感染者945人', '截至当地时间29日下午，日本新冠肺炎感染者共计945人，其中包括在日本国内的感染者和中国游客等226人，“钻石公主”号邮轮的乘客和乘务人员705人，以及乘坐日本政府包机回到日本国内的14人。其中在日本本土感染新冠肺炎死亡的有5人，在“钻石公主”号邮轮上感染新冠肺炎死亡的有6人，共计死亡人数达到11人。', '人民日报', 'http://m.weibo.cn/2803301701/4477359497897127', '2020-02-29 19:43:38');
INSERT INTO `news` VALUES ('235', '3小时前', '韩国新冠肺炎累计3150例', '【韩国一天增加813例 #韩国新冠肺炎累计3150例#】人民日报记者马菲消息：韩国中央防疫对策本部29日通报，截至当天下午4时，韩国较当天上午9时新增新冠肺炎确诊病例219例，累计确诊病例达3150例。与前一天下午4时相比，一天内新增确诊病例813例。#韩国确诊总数超过3000例# \n', '人民日报', 'http://m.weibo.cn/2803301701/4477335531381032', '2020-02-29 19:43:38');
INSERT INTO `news` VALUES ('236', '1小时前', '伊朗一天新增新冠肺炎385例', '【#伊朗一天新增新冠肺炎385例#，#伊朗累计新冠肺炎978例#】据外媒报道，伊朗卫生部发言人贾汉普尔3月1日在国家电视台宣布，过去24小时伊朗新增新冠肺炎感染者385例，累计978例，累计死亡人数达54例。（周輖） \n', '人民日报', 'http://m.weibo.cn/2803301701/4477747373604261', '2020-03-01 20:40:13');
INSERT INTO `news` VALUES ('237', '1小时前', '钻石公主号已全员下船', '【#钻石公主号已全员下船#】今日，日本厚生劳动大臣加藤胜信表示，发生新冠肺炎集体感染的“钻石公主”号上包括船长在内全员都已经下船。（总台记者何欣蕾） \n', '央视新闻', 'http://m.weibo.cn/2656274875/4477743666615825', '2020-03-01 20:40:13');
INSERT INTO `news` VALUES ('238', '2小时前', '武汉98岁新冠肺炎危重症患者出院', '【武汉#98岁新冠肺炎危重症患者出院#！】3月1日上午，截至目前全国年龄最大的新冠肺炎危重症患者、98岁高龄胡汉英从武汉雷神山医院治愈出院。跟胡汉英一起出院的，还有她54岁的女儿丁女士。@长江日报 长江日报的微博视频 \n', '人民网', 'http://m.weibo.cn/2286908003/4477735164044944', '2020-03-01 20:40:13');
INSERT INTO `news` VALUES ('239', '5小时前', '山东新增确诊2例，累计确诊758例', '2020年3月1日0-12时，山东省无新冠肺炎疑似病例;新增确诊病例2例(均为集中隔离观察的无症状感染者，经核酸和CT等检查确诊)，累计确诊病例758例(其中，重症病例8例，危重症病例2例，死亡病例6例);新增治愈出院8例，累计治愈出院439例。截至目前，追踪到密切接触者16872人，已解除医学观察15968人，诊断为疑似或确诊病例291例，尚有613人正在接受医学观察。', '山东卫健委', 'http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202003/t20200301_2595308.html', '2020-03-01 20:40:13');
INSERT INTO `news` VALUES ('240', '7小时前', '泰国现首例新冠肺炎死亡病例', '泰国朱拉隆功大学医学院新型传染病研究中心主任提叻瓦·合玛朱塔（Thiravat Hemachudha）透露，一名35岁泰国籍男性因感染新冠肺炎于2月29日傍晚在曼谷逝世，这是泰国首例新冠肺炎死亡病例。他还表示，这是一个重要案例，显示无症状感染者也可以传播病毒，而且就算没有慢性病史，也有可能转为危重病患。', '人民日报', 'http://m.weibo.cn/2803301701/4477655288451461', '2020-03-01 20:40:13');
INSERT INTO `news` VALUES ('241', '1小时前', '韩国累计确诊4335例新冠肺炎', '韩国中央防疫对策本部2日通报，截至当天下午4时，韩国较当天0时新增新冠肺炎确诊病例123例，累计确诊病例达4335例。受疫情影响，韩国全国幼儿园和中小学将再推迟两周开学，从3月9日延迟至3月23日。', '人民日报', 'http://m.weibo.cn/2803301701/4478066615459840', '2020-03-02 18:51:18');
INSERT INTO `news` VALUES ('242', '4小时前', '印尼确诊2例新冠肺炎', '据印度尼西亚《罗盘报》报道，印尼总统佐科2日宣布，印尼本土确诊2名新冠病毒感染者。据悉，此次确诊的两人与此前从日本来印尼旅游后回国确诊的患者曾有过接触。', '人民日报', 'http://m.weibo.cn/2803301701/4478021379919788', '2020-03-02 18:51:18');
INSERT INTO `news` VALUES ('243', '6小时前', '日本新冠肺炎确诊达962人', '截至当地时间2日上午10点半，日本新冠肺炎确诊病例累计962人，其中包括在日本国内的确诊患者和中国游客等243人，“钻石公主”号邮轮乘客和乘务人员705人，以及乘坐日本政府包机回到日本国内的14人。其中在日本本土因新冠肺炎死亡的有6人，在“钻石公主”号邮轮上死亡6人，共计死亡人数12人。\n', '人民日报', 'http://m.weibo.cn/2803301701/4477994074257431', '2020-03-02 18:51:18');
INSERT INTO `news` VALUES ('244', '7小时前', '美国现第二例新冠肺炎死亡病例', '当地时间3月1日，美国华盛顿州卫生部门称，该州金郡1名新冠肺炎患者死亡，成为全美第二例因新冠肺炎死亡的病例。据悉，包括该名逝者在内的6名确诊患者，均来自当地一家养老院。目前，金郡1/4的消防队员处于隔离状态，因他们中不少人在没有使用防护装备的情况下，前往养老院参与急救工作。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4477978023339926', '2020-03-02 18:51:18');
INSERT INTO `news` VALUES ('245', '7小时前', '北京市新增1例确诊病例，6例治愈出院 ', '3月1日0时至24时，北京市新增1例新冠肺炎确诊病例，为确诊病例的密切接触者，已送至定点医疗机构进行救治。报告新增疑似病例12例、密切接触者38人。治愈出院患者6例，分别从市区两级定点医院出院。', '北京卫健委', 'http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202003/t20200302_1673414.html', '2020-03-02 18:51:18');
INSERT INTO `news` VALUES ('246', '4小时前', '韩国军队31人感染新冠肺炎', '今天，韩国国防部通报：截至当天上午，韩国军队内部累计确诊感染病例已增至31例。新增确诊患者2例来自大邱，1例为庆尚北道港口城市浦项的海军陆战队军官。目前，韩国已有约7410名现役军人在各自基地隔离，其中约860人属确诊患者的密切接触者，或表现出相关病症。', '央视新闻', 'http://m.weibo.cn/2656274875/4478351211168515', '2020-03-03 16:55:48');
INSERT INTO `news` VALUES ('247', '5小时前', '天津市新型冠状病毒肺炎疫情情况', '2020年3月2日0－24时，天津市报告新型冠状病毒肺炎新增确诊病例0例，新增危重型病例0例，新增重型病例0例，新增死亡病例0例，新增治愈出院病例7例。截至3月2日24时，天津市累计报告新型冠状病毒肺炎确诊病例136例，出院病例118例，死亡病例3例。现有在院治疗确诊病例15例（危重型病例1例，重型病例1例）。', '天津卫健委', 'http://wsjk.tj.gov.cn/art/2020/3/3/art_87_71762.html', '2020-03-03 16:55:48');
INSERT INTO `news` VALUES ('248', '5小时前', '浙江7例境外输入病例均与浙江首例境外输入病例在意大利同一餐厅工作', '2日，浙江新增7例新冠肺炎均为输入病例。该7例病例与首例境外输入病例王某某为密切接触者，在意大利贝加莫同一家餐厅工作，8人一直生活在意大利，无湖北武汉接触史。2月28日，患者乘坐LH0273航班从意大利到德国。2月29日，从德国乘坐CA0936航班到达上海浦东机场。2月29日，患者包车进入青田，当即落实隔离观察措施。3月2日，新冠肺炎核酸检测呈阳性，现正在定点医院隔离治疗。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4478335712960367', '2020-03-03 16:55:48');
INSERT INTO `news` VALUES ('250', '5小时前', '黄石两村民发热打牌致多人感染，与村支书同被立案', '2月21日至23日，太子镇老屋村4人先后被确诊为新冠肺炎。其中，潘某松、王某无视疫情管控规定，2月5日至16日期间频繁出入，在出现发热、咳嗽症状后，潘某松恶意隐瞒，聚集村民购物、打牌、垂钓，导致多名家人和牌友被感染。目前，老屋村确诊人数已达7人。因对村民放任自流，玩忽职守，严重违反防控指令，原老屋村党支部书记、村委会主任王某凤已被撤销党内职务，依法罢免村委会主任职务。3月1日，黄石开发区·铁山区公安分局依法对王某凤、潘某松、王某三人因涉嫌妨害传染病防治罪立案侦查。\n', '人民网', 'http://m.weibo.cn/2286908003/4478335633357393', '2020-03-03 16:55:48');
INSERT INTO `news` VALUES ('251', '9小时前', '北京新增3例确诊2例为境外输入病例', '3月3日0时至24时，北京市新增3例新冠肺炎确诊病例，其中2例为境外输入病例（1例为伊朗输入病例，1例为意大利输入病例），1例为北京市本地病例。报告新增疑似病例11例、密切接触者61人。截至3日24时，累计确诊病例417例，治愈出院病例294例，死亡病例8例。现有疑似病例38例。累计确定密切接触者2796人，其中309人尚在隔离医学观察中。', '央视新闻', 'http://m.weibo.cn/2656274875/4478710738827772', '2020-03-04 20:58:28');
INSERT INTO `news` VALUES ('252', '9小时前', '日本确诊新冠肺炎数破千', '根据日本厚生劳动省今天上午的信息：日本的新冠肺炎感染者已达1000人。其中，日本国内确诊280例，包机从武汉接回14例，“钻石公主号”邮轮上确诊706例。', '央视新闻', 'http://m.weibo.cn/2656274875/4478704308459475', '2020-03-04 20:58:28');
INSERT INTO `news` VALUES ('253', '10小时前', '湖北新增115例新冠肺炎，累计确诊67332例', '湖北新增确诊病例115例（武汉114例），新增治愈出院病例2389例（武汉1859例），新增死亡病例37例（武汉31例），现有确诊病例25905例（武汉22368例），其中重症病例6232例（武汉5723例）。累计治愈出院病例38556例（武汉24890例），累计死亡病例2871例（武汉2282例），累计确诊病例67332例（武汉49540例）。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4478690086002298', '2020-03-04 20:58:28');
INSERT INTO `news` VALUES ('254', '10小时前', '31省区市新增119例新冠肺炎病例，武汉新增114例新冠肺炎', '3月3日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例119例，新增死亡病例38例（湖北37例，内蒙古1例），新增疑似病例143例。湖北新增确诊病例115例（武汉114例），新增治愈出院病例2389例（武汉1859例），新增死亡病例37例（武汉31例），现有确诊病例25905例（武汉22368例），其中重症病例6232例（武汉5723例）。', '央视新闻', 'http://m.weibo.cn/2656274875/4478689192851403', '2020-03-04 20:58:28');
INSERT INTO `news` VALUES ('255', '10小时前', '韩国新增新冠肺炎516例，累计新冠肺炎5328例', '人民日报记者马菲消息，韩国中央防疫对策本部4日通报，截至4日0时，韩国较3日下午4时新增新冠肺炎确诊病例142例，累计确诊病例达5328例。3日全天新增确诊病例516例。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4478683165582977', '2020-03-04 20:58:28');
INSERT INTO `news` VALUES ('256', '38分钟前', '火神山医院累计治愈患者超千人', '【#火神山医院累计治愈患者超千人#】3月5日14时许，火神山医院又有88名确诊患者治愈出院。至此，火神山医院已累计治愈新冠肺炎确诊患者1009人。#万众一心抗击疫情# @人民日报 \n', '人民网', 'http://m.weibo.cn/2286908003/4479135323470529', '2020-03-05 16:54:45');
INSERT INTO `news` VALUES ('257', '2小时前', '湖北开设新冠肺炎康复门诊', '【出院患者越来越多！#湖北开设新冠肺炎康复门诊#】#万众一心抗击疫情#随着新冠肺炎出院的患者越来越多，出院后复诊和尽快康复成为患者的新需求。3月5日起，湖北省中医院光谷院区正式开设接诊新冠肺炎出院患者的康复门诊。目前，康复门诊主要针对隔离点患者、居家隔离患者提供恢复期治疗与康复指导。@湖北之声\n', '人民网', 'http://m.weibo.cn/2286908003/4479105825228637', '2020-03-05 16:54:45');
INSERT INTO `news` VALUES ('258', '4小时前', '又一艘公主号邮轮发生疫情', '#又一艘公主号邮轮发生疫情#【#加州死亡病例乘坐邮轮21人出现症状#】据美媒报道，美国加州一名71岁的男性新冠肺炎死者曾乘坐“至尊公主”号邮轮。该邮轮载有2500名乘客，与“钻石公主”号同样隶属于“公主邮轮”公司。邮轮10—21日自旧金山出发前往墨西哥，返回旧金山后21日又前往夏威夷。加州州长4日表示，邮轮上有11名乘客和10名船员“出现症状”，目前尚未靠岸。加州方面正与美国疾控中心和当地的医疗保健合作伙伴共享邮轮乘客名单并进行调查。网页链接\n', '人民日报', 'http://m.weibo.cn/2803301701/4479082018053601', '2020-03-05 16:54:45');
INSERT INTO `news` VALUES ('259', '4小时前', '意大利政府叫停境内所有体育赛事', '截至当地时间3月4日18时，意大利确诊病例升至3089例，累计死亡107例。今天（5日）凌晨，意大利政府官方宣布，受新冠肺炎疫情影响，包括意甲联赛在内的所有意大利境内体育赛事都必须空场进行，直至4月3日。\n', '人民网', 'http://m.weibo.cn/2286908003/4479071997862391', '2020-03-05 16:54:45');
INSERT INTO `news` VALUES ('260', '5小时前', '62个国家7个国际组织向中国捐赠防控物资', '外交部副部长马朝旭：截至3月2日，共有62个国家和7个国际组织向中国捐赠了口罩防护服等等中国急需的疫情防控物资。这里面不光是数字，还有很多感人故事。缅甸政府提供大米，斯里兰卡提供红茶，蒙古捐赠3万只羊，巴基斯坦拿出全国医院库存口罩给中国。这些捐助是雪中送炭，患难见真情，我们将铭记在心。 ', '人民网', 'http://m.weibo.cn/2286908003/4479068940203454', '2020-03-05 16:54:45');
INSERT INTO `news` VALUES ('261', '2小时前', '韩国新冠肺炎确诊病例新增309例', '韩国中央防疫对策本部6日通报，截至6日下午4时，韩国较当天零时新增新冠肺炎确诊病例309例，累计确诊病例6593例。', '人民日报', 'http://m.weibo.cn/2803301701/4479512157072486', '2020-03-06 19:16:17');
INSERT INTO `news` VALUES ('262', '4小时前', '上海新增3例境外输入新冠肺炎病例', '2020年3月6日0—12时，上海市排除新型冠状病毒肺炎疑似病例2例；新增治愈出院3例；新增3例确诊病例，为境外输入型病例。3例确诊病例中，2例为中国宁夏籍，1例为中国甘肃籍，均在伊朗留学，均自伊朗德黑兰出发，经泰国曼谷转机后分别于3月2日晚和3月3日凌晨抵达上海浦东国际机场，入关后即被送至集中隔离点观察。', '人民网', 'http://m.weibo.cn/2286908003/4479477444254577', '2020-03-06 19:16:17');
INSERT INTO `news` VALUES ('263', '7小时前', '美国新冠肺炎确诊达232人，死亡14例', '人民日报记者张梦旭消息，据美国约翰·霍普金斯大学发布的实时统计数据显示，截至美东时间5日晚9点，美国各州公共卫生部门共报告新冠肺炎感染病例232例，死亡14例。与美国疾病控制和预防中心截至4日下午4时的数据相比，美国5日新增确诊病例84例，新增死亡病例3例。', '人民日报', 'http://m.weibo.cn/2803301701/4479426802719572', '2020-03-06 19:16:17');
INSERT INTO `news` VALUES ('264', '8小时前', '湖北新增确诊病例126例，累计确诊病例67592例', '据国家卫健委，湖北新增确诊病例126例（武汉126例），新增治愈出院病例1487例（武汉1038例），新增死亡病例29例（武汉23例），现有确诊病例22695例（武汉20115例），其中重症病例5588例（武汉5208例）。累计治愈出院病例41966例（武汉27354例），累计死亡病例2931例（武汉2328例），累计确诊病例67592例（武汉49797例）。\n', '人民网', 'http://m.weibo.cn/2286908003/4479412726596267', '2020-03-06 19:16:17');
INSERT INTO `news` VALUES ('265', '8小时前', '全国31省区市新增143例，累计报告80552例', '3月5日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例143例，新增死亡病例30例（湖北29例,海南1例），新增疑似病例102例。截至3月5日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例23784例（其中重症病例5737例），累计治愈出院病例53726例，累计死亡病例3042例，累计报告确诊病例80552例，现有疑似病例482例。', '人民网', 'http://m.weibo.cn/2286908003/4479412449462145', '2020-03-06 19:16:17');
INSERT INTO `news` VALUES ('266', '5小时前', '@ 全体一线社区工作者，国家保障来了！', '3月3日，中央印发《关于全面落实疫情防控一线城乡社区工作者关心关爱措施的通知》，明确：①地方可为疫情防控一线城乡社区工作者发放适当工作补助；②坚决制止多头重复向基层派任务；③采取轮休、补休方式，保证及时得到必要调整……', '人民网', 'http://m.weibo.cn/2286908003/4479787584703699', '2020-03-07 16:42:43');
INSERT INTO `news` VALUES ('267', '6小时前', '韩国新增483例新冠肺炎，累计确诊6767例', '韩国中央防疫对策本部7日通报，截至7日零时，韩国较6日零时新增新冠肺炎确诊病例483例，累计确诊病例达6767例，韩国共出现44例死亡病例。\n', '人民日报', 'http://m.weibo.cn/2803301701/4479770580576061', '2020-03-07 16:42:43');
INSERT INTO `news` VALUES ('268', '6小时前', '江苏无新增新型冠状病毒肺炎确诊病例', '2020年3月6日0-24时，江苏省无新增新型冠状病毒肺炎确诊病例。新增出院病例13例。1例危重型病例转为重型病例，1例重型病例转为普通型病例。截至3月6日24时，江苏省累计报告新型冠状病毒肺炎确诊病例631例。目前，江苏省追踪到密切接触者12639人，已解除医学观察12596人，尚有43人正在接受医学观察。', '江苏卫健委', 'http://wjw.jiangsu.gov.cn/art/2020/3/7/art_7290_9000008.html', '2020-03-07 16:42:43');
INSERT INTO `news` VALUES ('269', '6小时前', '美国新冠肺炎确诊达324例', '根据美国疾病控制与预防中心以及各州公共卫生部门的统计，截至美东时间6日晚7时，全美共出现新冠肺炎确诊病例324例，死亡病例14例，治愈病例10例。其中，6日#美国新增85例确诊病例#。目前，全美共有25个州出现确诊病例，其中华盛顿州80例，加利福尼亚州62例，纽约州44例。先后有华盛顿州、佛罗里达州、加利福尼亚州和马里兰州宣布进入紧急状态。美国总统特朗普6日签署了总额83亿美元的应对新冠病毒紧急拨款法案。\n', '人民日报', 'http://m.weibo.cn/2803301701/4479766633950382', '2020-03-07 16:42:43');
INSERT INTO `news` VALUES ('270', '6小时前', '浙江省无新增新型冠状病毒肺炎确诊病例，新增出院病例8例', '2020年3月6日0-24时，浙江省无新增新型冠状病毒肺炎确诊病例，新增出院病例8例。其中：  新增出院病例中，温州市5例、台州市1例、省十里丰监狱2例。截至3月6日24时，浙江省累计报告新型冠状病毒肺炎确诊病例1215例（其中境外输入病例10例），现有重症病例2例（其中危重1例），累计死亡1例，累计出院1161例。 全省共追踪到密切接触者42085人，当日解除医学观察44人，尚有847人正在接受医学观察。\n', '浙江卫健委', 'https://www.zjwjw.gov.cn/art/2020/3/7/art_1202101_42167121.html', '2020-03-07 16:42:43');
INSERT INTO `news` VALUES ('271', '2小时前', '新疆确诊病例清零', '【#新疆确诊病例清零#】今天，新疆维吾尔自治区（含新疆生产建设兵团）最后1例新冠肺炎确诊病例治愈出院。至此，新疆（含兵团）实现新冠肺炎确诊病例清零！新疆（含兵团）累计报告新冠肺炎确诊76例，累计治愈出院73例、死亡3例；已连续18天无新增确诊病例。（总台央视记者刘菲） \n', '央视新闻', 'http://m.weibo.cn/2656274875/4480199732969697', '2020-03-08 16:46:15');
INSERT INTO `news` VALUES ('272', '6小时前', '韩国新增367例新冠肺炎，累计7134例', '韩国中央防疫对策本部8日通报，截至8日零时，韩国较7日零时新增新冠肺炎确诊病例367例，累计确诊病例达7134例，共出现50例死亡病例。 \n', '人民网', 'http://m.weibo.cn/2286908003/4480135502176761', '2020-03-08 16:46:15');
INSERT INTO `news` VALUES ('273', '6小时前', '北京新增2例境外输入确诊病例', '据北京市卫健委通报，3月7日0时至24时，北京新增2例新冠肺炎确诊病例，1例来自意大利的境外输入病例，1例来自西班牙的境外输入病例，均已送至定点医疗机构进行救治。新增报告疑似病例3例、密切接触者87人。治愈出院患者5例，分别从市区两级定点医院出院。', '人民日报', 'http://m.weibo.cn/2803301701/4480128094302491', '2020-03-08 16:46:15');
INSERT INTO `news` VALUES ('274', '6小时前', '湖北外新增确诊3例均为境外输入', '据国家卫健委通报，3月7日0—24时，新增报告境外输入确诊病例3例（北京2例，甘肃1例）。截至3月7日24时，累计报告境外输入确诊病例63例。 \n', '央视新闻', 'http://m.weibo.cn/2656274875/4480126513433158', '2020-03-08 16:46:15');
INSERT INTO `news` VALUES ('275', '7小时前', '31省区市累计新冠肺炎80695例，武汉新增41例新冠肺炎', '3月7日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例44例，新增死亡病例27例（湖北27例），新增疑似病例84例。  当日新增治愈出院病例1661例，解除医学观察的密切接触者4021人，重症病例减少225例。  截至3月7日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例20533例（其中重症病例5264例），累计治愈出院病例57065例，累计死亡病例3097例，累计报告确诊病例80695例，现有疑似病例458例。', '央视新闻', 'http://m.weibo.cn/2656274875/4480120783934667', '2020-03-08 16:46:15');
INSERT INTO `news` VALUES ('276', '1小时前', '受疫情影响伊朗释放7万名囚犯', '【#受疫情影响伊朗释放7万名囚犯#】据伊朗塔斯尼姆通讯社9号消息，受新冠肺炎疫情影响，伊朗司法总监易卜拉欣·莱西表示，目前已经批准70000名符合条件的囚犯获得暂时释放，而患有潜在疾病的囚犯将优先获释。（总台记者倪紫慧） \n', '央视新闻', 'http://m.weibo.cn/2656274875/4480641582195474', '2020-03-09 20:38:25');
INSERT INTO `news` VALUES ('277', '1小时前', '伊朗确诊新冠肺炎升至7161例', '【#伊朗确诊新冠肺炎升至7161例#】伊朗卫生部3月9日宣布，过去一天伊朗境内新增新冠肺炎感染者595例，累计7161例，新增死亡43例，累计237例，#伊朗已有2394例新冠肺炎治愈#。（周輖） \n', '人民日报', 'http://m.weibo.cn/2803301701/4480640231232040', '2020-03-09 20:38:25');
INSERT INTO `news` VALUES ('278', '3小时前', '韩国确诊新冠肺炎升至7478例', '【#韩国确诊新冠肺炎升至7478例#】韩国中央防疫对策本部9日通报，截至9日下午4时，韩国较当天零时新增新冠肺炎确诊病例96例，累计确诊病例7478例。韩国中央应急处置本部第一总括协调官金刚立9日在例行记者会上表示，韩国政府今后将在全力遏制疫情社区扩散的同时，严防疫情从境外流入。（马菲） \n', '人民日报', 'http://m.weibo.cn/2803301701/4480603061482142', '2020-03-09 20:38:25');
INSERT INTO `news` VALUES ('280', '9小时前', '疫情防控过程中，全国53位社区工作者因公殉职', '民政部基层政权建设和社区治理司司长陈越良表示，截至3月8日，全国城乡社区工作者已有53位在疫情防控过程中因公殉职，其中共产党员占92.5%。\n', '人民网', 'http://m.weibo.cn/2286908003/4480513521874725', '2020-03-09 20:38:25');
INSERT INTO `news` VALUES ('281', '2小时前', '上海新增2例境外输入病例', '3月10日0—12时，上海市排除新型冠状病毒肺炎疑似病例6例；新增治愈出院4例；新增2例确诊病例，是通过联防联控机制发现的境外输入型病例。2例确诊病例均为中国福建籍，在意大利工作生活，均自意大利博洛尼亚出发，经俄罗斯莫斯科转机后于3月8日抵达上海浦东国际机场，因有症状，入关后即被送至指定医疗机构留观。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4480927097005277', '2020-03-10 17:04:56');
INSERT INTO `news` VALUES ('282', '4小时前', '蒙古国境内出现首例新冠肺炎', '据蒙古国家通讯社10日报道，蒙古国紧急情况委员会主席、副总理恩赫图布辛在今晨6时召开会议上说，蒙古国确诊首例新冠肺炎病例。该患者为3月2日乘莫斯科至乌兰巴托航班抵达蒙古国的法国公民。', '人民日报海外版', 'http://m.weibo.cn/3057540037/4480887959414175', '2020-03-10 17:04:56');
INSERT INTO `news` VALUES ('283', '5小时前', '日本国内确诊新冠肺炎510例 死亡9例', '截至10 日上午10时30分，日本国内累计确诊新冠肺炎病例510例。此外，“钻石公主”号邮轮确诊的乘客及乘务人员确诊696例，乘坐日本政府包机回到日本国内的14人，日本累计确诊新冠肺炎病例1220人。确诊病例中包括16例死亡病例，包括在国内感染的9人，以及“钻石公主”号邮轮的乘客7人。', '人民日报海外版', 'http://m.weibo.cn/3057540037/4480879243654708', '2020-03-10 17:04:56');
INSERT INTO `news` VALUES ('284', '6小时前', '韩国新增确诊131例，累计确诊升至7513例', '据人民日报记者马菲，韩国中央防疫对策本部10日通报，截至10日零时，韩国较9日零时新增新冠肺炎确诊病例131例，累计确诊病例7513例，共出现54例死亡病例。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4480857898994763', '2020-03-10 17:04:56');
INSERT INTO `news` VALUES ('285', '7小时前', '广东新增1例境外输入病例 系中国留学生', '9日，广东东莞市卫生健康局报告1例境外输入新冠肺炎病例。患者为中国留学生，3月7日从西班牙乘坐航班（CX320）回国，3月8日到达香港国际机场，在深圳湾口岸入境，体温正常，口岸对其进行了核酸检测。9日，核酸检测结果阳性。目前，患者已转入东莞市第九人民医院隔离治疗。已初步找到6名密切接触者，均已集中隔离观察。', '央视新闻', 'http://m.weibo.cn/2656274875/4480849263272345', '2020-03-10 17:04:56');
INSERT INTO `news` VALUES ('286', '11分钟前', '伊朗累计确诊新冠肺炎9000例#，一天新增958例', '伊朗卫生部3月11日宣布，过去一天伊朗境内新增新冠肺炎感染者958例，累计9000例，新增死亡63例，累计354例，已有2959人治愈。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4481362855702315', '2020-03-11 19:28:49');
INSERT INTO `news` VALUES ('287', '2小时前', '截至3月10日18时，意大利累计确诊升至10149例', '【#意大利抗疫Vlog#：疫情下的意大利发生了哪些变化？】截至3月10日18时，#意大利累计确诊升至10149例#。疫情发生前后，意大利普通居民的生活受到哪些影响？全国封城后，是否还能正常出行？超市里还能买到足够的生活物资吗？戳↓↓Amelie欧洲游记的微博视频 \n', '人民日报', 'http://m.weibo.cn/2803301701/4481331234462494', '2020-03-11 19:28:49');
INSERT INTO `news` VALUES ('288', '3小时前', '河南郑州市确诊1例境外输入新冠肺炎病例，该病例是郑州首例境外输入性确诊病例。', '【河南#郑州境外输入病例隐瞒行程被立案#】今天12时40分，河南郑州市确诊1例境外输入新冠肺炎病例，该病例是郑州首例境外输入性确诊病例。该男子刻意隐瞒境外行程，目前当地警方已立案侦查。', '央视新闻', 'http://m.weibo.cn/2656274875/4481316156275455', '2020-03-11 19:28:49');
INSERT INTO `news` VALUES ('289', '3小时前', '114国家地区37449例新冠肺炎', '截至北京时间3月11日12时，除中国外，114个国家和地区累计确诊37449例新冠肺炎，累计死亡1136例。转发关注#新冠肺炎疫情全球走势#。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4481310301238254', '2020-03-11 19:28:49');
INSERT INTO `news` VALUES ('290', '5小时前', '截至3月11日12时云南省新冠肺炎疫情情况', '3月11日0时至12时，无新增确诊病例。截至3月11日12时，全省累计确诊病例174例，治愈出院170例，死亡2例，现有确诊病例2例，无重症、危重症病例。各州市累计确诊病例：昆明市53例（治愈出院53例），昭通市25例（治愈出院25例），西双版纳州15例（治愈出院14例、死亡1例），玉溪市14例（治愈出院13例、死亡1例），曲靖市13例（治愈出院12例），大理州13例（治愈出院13例），保山市9例（治愈出院9例），红河州9例（治愈出院9例），丽江市7例（治愈出院7例），德宏州5例（治愈出院4例），普洱市4例（治愈出院4例），楚雄州4例（治愈出院4例），文山州2例（治愈出院2例），临沧市1例（治愈出院1例）。自3月3日开始，全省129个县市区均为低风险。 \n				', '云南卫健委', 'http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158390205534980301', '2020-03-11 19:28:49');
INSERT INTO `news` VALUES ('291', '3小时前', '山东省新增治愈出院1例', '2020年3月12日0-12时，山东省本地无新增确诊病例，无新增疑似病例，累计报告确诊病例759例(其中，重症病例1例，危重症病例1例，累计死亡病例6例);新增治愈出院1例，累计治愈出院734例。目前共追踪到密切接触者17168人，尚有198人正在接受医学观察。', '山东卫健委', 'http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202003/t20200312_3047336.html', '2020-03-12 19:52:24');
INSERT INTO `news` VALUES ('292', '6小时前', '泰国聚集性感染11人确诊，累计确诊70例新冠肺炎', '11日，泰国卫生部在每日疫情发布会上表示，泰国新增11例新冠肺炎确诊病例。这11例确诊病例为聚集性传播事件。患者全为泰国人，曾于2月27日和29日参加聚会，而其中一人与香港一名确诊病例为密切接触者。截至当地时间11日上午，泰国累计确诊病例70例。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4481624458974290', '2020-03-12 19:52:24');
INSERT INTO `news` VALUES ('293', '6小时前', '上海有1例确诊病例3月12日出院', '上海市卫生健康委今日（12日）通报：1例新型冠状病毒肺炎病例，经定点医疗机构医护人员精心诊治和护理，专家组评估，认为符合国家卫生健康委最新的新型冠状病毒肺炎确诊病例解除隔离和出院标准，于今日出院。', '上海卫健委', 'http://wsjkw.sh.gov.cn/xwfb/20200312/7291303bbbbe4160a53044e788dba073.html', '2020-03-12 19:52:24');
INSERT INTO `news` VALUES ('294', '9小时前', '韩国新冠肺炎确诊病例新增114例，累计7869例新冠肺炎', '韩国中央防疫对策本部12日通报，截至12日零时，韩国较11日零时新增新冠肺炎确诊病例114例，累计确诊病例7869例，共出现66例死亡病例。 \n', '人民日报', 'http://m.weibo.cn/2803301701/4481582335128659', '2020-03-12 19:52:24');
INSERT INTO `news` VALUES ('295', '9小时前', '意大利一天新增2313例新冠肺炎', '当地时间11日18时，意大利民防部门公布的最新数据显示：在过去一天内，意大利新增新冠肺炎确诊病例2313例，累计确诊新冠肺炎病例12462例。新增死亡病例196例，累计死亡827人。累计治愈1045人。目前意大利现存新冠肺炎病例10590例，其中重症病患1028例。 \n', '央视新闻', 'http://m.weibo.cn/2656274875/4481579508593547', '2020-03-12 19:52:24');
INSERT INTO `news` VALUES ('296', '5小时前', '湖北除武汉外连续8天零新增', '3月12日0—24时，湖北新增确诊病例5例，其中武汉新增5例新冠肺炎，湖北除武汉外新增为0。加油！ \n', '央视新闻', 'http://m.weibo.cn/2656274875/4481968522056994', '2020-03-13 16:55:55');
INSERT INTO `news` VALUES ('297', '5小时前', '31省区新冠肺炎情况报告', '3月12日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例8例，新增死亡病例7例（湖北6例，山东1例），新增疑似病例33例。  当日新增治愈出院病例1318例，解除医学观察的密切接触者2483人，重症病例减少237例。   3月12日0—24时，新增报告境外输入确诊病例3例（上海2例，北京1例）。截至3月12日24时，累计报告境外输入确诊病例88例。  累计收到港澳台地区通报确诊病例190例：香港特别行政区131例（出院75例，死亡3例），澳门特别行政区10例（出院10例），台湾地区49例（出院20例，死亡1例）。', '央视新闻', 'http://m.weibo.cn/2656274875/4481967850170132', '2020-03-13 16:55:55');
INSERT INTO `news` VALUES ('298', '5小时前', '联合国纽约总部出现首例确诊', '据路透社报道，当地时间12日，菲律宾驻联合国代表团中的一名女性外交官在新冠病毒检测中呈阳性，这是联合国纽约总部发现的首例感染新冠肺炎的病例。据悉，这名生病的菲律宾外交官最后一次出现在联合国总部是在3月9日，大约半个小时，当时没有症状。她于10日开始出现类似流感的症状。', '人民日报海外版', 'http://m.weibo.cn/3057540037/4481954806707744', '2020-03-13 16:55:55');
INSERT INTO `news` VALUES ('300', '6小时前', '纽约进入紧急状态，下周确诊或增长10倍', '当地时间3月12日，美国最大都市纽约市市长宣布：鉴于新冠肺炎疫情发展，纽约市正式进入紧急状态。执行包括禁止500人以上场所聚集、强制公共场合减少额定人数二分之一等措施。他悲观预测下周确诊病例数字可能会突破1000人。', '央视新闻', 'http://m.weibo.cn/2656274875/4481947797679510', '2020-03-13 16:55:55');
INSERT INTO `news` VALUES ('301', '37分钟前', '湖南新冠肺炎确诊患者全部清零', '【#湖南清零#！#湖南新冠肺炎确诊患者全部清零#】3月14日下午，长沙市最后1名在院治疗确诊病例出院，至此，长沙市在院确诊病例已全部清零。这也意味着，湖南新冠肺炎确诊患者清零！（何勇、王云娜） \n', '人民日报', 'http://m.weibo.cn/2803301701/4482411779993765', '2020-03-14 18:04:19');
INSERT INTO `news` VALUES ('302', '6小时前', '美国新冠肺炎确诊病例突破2000', '据美国有线电视新闻网报道，截至美东时间13日下午，美国至少有2033例新冠肺炎确诊病例，其中包括死亡病例47例。据统计，2033例确诊病例中，46例来自日本“钻石公主”号撤侨人员，21例来自“至尊公主”号，3例来自武汉撤侨人员，剩余1963例分布在美国48个州和首都华盛顿哥伦比亚特区。', '人民日报', 'http://m.weibo.cn/2803301701/4482317135458740', '2020-03-14 18:04:19');
INSERT INTO `news` VALUES ('303', '8小时前', '上海新增4例境外输入病例：均来自意大利', '2020年3月13日12—24时，上海市排除新型冠状病毒肺炎疑似病例15例；新增4例确诊病例，均为通过联防联控机制发现的境外输入型病例。病例1为意大利籍，在本市工作生活，病例2为中国浙江籍，在意大利工作生活，3月11日自意大利博洛尼亚出发，经俄罗斯莫斯科转机，于3月12日抵达上海浦东国际机场，入关后即被集中隔离观察。病例3、病例4为中国浙江籍，在意大利工作生活，3月11日自意大利米兰出发，经俄罗斯莫斯科转机，于3月12日抵达上海浦东国际机场，入关后即被集中隔离观察。综合流行病学史、临床症状、实验室检测结果和影像学检查等，诊断为确诊病例。', '人民日报', 'http://m.weibo.cn/2803301701/4482285921215262', '2020-03-14 18:04:19');
INSERT INTO `news` VALUES ('304', '9小时前', '甘肃新增2例境外输入新冠肺炎', '3月13日20时至3月14日0时，甘肃省新增境外输入新冠肺炎确诊病例2例，均为来自沙特阿拉伯的境外输入病例。2020年3月11日由沙特阿拉伯经埃塞俄比亚、广州转机，于3月12日23时到达兰州。3月13日21时核酸检测阳性，3月13日22时确诊为新冠肺炎病例。目前在临夏州定点医院住院隔离治疗。新增2例病例的密切接触者34人，均集中隔离医学观察。', '人民日报', 'http://m.weibo.cn/2803301701/4482279457997645', '2020-03-14 18:04:19');
INSERT INTO `news` VALUES ('305', '9小时前', '德国新冠肺炎确诊病例超3千，多州下周起关闭学校', '根据德国疾病防控机构罗伯特·科赫研究所最新公布的数据显示，截至当地时间3月13日15时，德国共确诊3062例新冠病毒肺炎感染病例，其中死亡病例5例，较3月12日15时，新增693例。为延缓疫情蔓延，德国几乎所有联邦州都已宣布，将从下周开始暂时关闭学校，停止教学活动。德国足球职业联盟主席团临时决定，推迟原定于本周末进行的德甲、德乙本轮联赛，并暂停联赛至4月2日。\n', '人民日报', 'http://m.weibo.cn/2803301701/4482275389434665', '2020-03-14 18:04:19');
INSERT INTO `news` VALUES ('306', '28分钟前', '零死亡！宁夏确诊病例清零', '3月16日16时，最后2名治愈患者走出自治区第四人民医院隔离病区，宁夏75例新冠肺炎确诊病例已全部出院。经过诊疗专家组和医护人员63个日夜坚守，确诊病例治愈率100%，实现了疫情防控救治零确诊、零疑似、医务人员零感染、密切接触者清零的四个“清零”。（人民日报记者刘峰）\n', '人民日报', 'http://m.weibo.cn/2803301701/4483140900884657', '2020-03-16 17:56:31');
INSERT INTO `news` VALUES ('307', '1小时前', ' 北京3月16日0时至14时新增报告境外输入确诊病例6例 ', '\n3月16日0时至14时，北京无新增报告本地新冠肺炎确诊病例。出院病例2例。截至3月16日14时，累计报告本地确诊病例415例，出院358例，治愈出院率达到86.3%。新增境外输入病例6例,其中西班牙4例、英国2例。无出院病例。截至3月16日14时，累计报告境外输入确诊病例37例，出院2例。\n                            \n                ', '北京卫健委', 'http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202003/t20200316_1711595.html', '2020-03-16 17:56:31');
INSERT INTO `news` VALUES ('308', '5小时前', '捷克宣布全国隔离', '当地时间15日深夜，捷克政府宣布：从16日0时至24日早6时，除工作或紧急事务，任何居住在捷克共和国境内的人都不得离开自己的住所，全国民众居家隔离。此外，关闭境内酒店民宿，禁止使用共享出租车，建议使用非现金方式付款。截至当地时间15日24时，捷克累计确诊新冠肺炎293例。\n', '央视新闻', 'http://m.weibo.cn/2656274875/4483064778472648', '2020-03-16 17:56:31');
INSERT INTO `news` VALUES ('309', '5小时前', '好消息！贵州所有确诊病例全部治愈', '今天上午10点40分，贵州省收治的最后一名新冠肺炎患者从贵州省将军山医院出院。至此，新冠肺炎疫情发生以来，贵州省收治的146例确诊病例已全部治愈出院。', '央视新闻', 'http://m.weibo.cn/2656274875/4483062924149409', '2020-03-16 17:56:31');
INSERT INTO `news` VALUES ('310', '6小时前', '日本15个地区发现群体性新冠病毒感染', '据日本共同社16日消息，日本厚生劳动省称，日本10个都道府县的15个地区，发现了群体性新冠肺炎病毒感染。', '人民日报海外版', 'http://m.weibo.cn/3057540037/4483044309949214', '2020-03-16 17:56:31');
INSERT INTO `news` VALUES ('311', '1小时前', '德国累计确诊8198例新冠肺炎', '据德国联邦疾控机构罗伯特·科赫研究所，截至当地时间3月18日10点30分，德国已累计确诊新冠肺炎患者8198例。', '央视新闻', 'http://m.weibo.cn/2656274875/4483924375916060', '2020-03-18 22:11:08');
INSERT INTO `news` VALUES ('312', '2小时前', '西班牙新冠肺炎增至13716例', '据西班牙卫生部18日公布的数据，西班牙较前日新增新冠肺炎确诊病例2538例，累计确诊病例达13716例，其中598人死亡，774人病情危重，1081人治愈出院。', '人民日报', 'http://m.weibo.cn/2803301701/4483904154996671', '2020-03-18 22:11:08');
INSERT INTO `news` VALUES ('313', '3小时前', '伊朗累计确诊17361例新冠肺炎', '根据伊朗卫生部最新消息，截至当地时间18日中午，伊朗累计确诊新冠肺炎病例17361例，其中5710例康复，1135例死亡。', '央视新闻', 'http://m.weibo.cn/2656274875/4483897113079266', '2020-03-18 22:11:08');
INSERT INTO `news` VALUES ('314', '6小时前', '疫情已扩散到159个国家和地区', '【#疫情已扩散到159个国家和地区#】国家卫生健康委新闻发言人、宣传司副司长米锋介绍，根据世卫组织通报，全球疫情已经扩散到159个国家和地区，要防止境外输入疫情，积极开展国际合作。 人民日报的微博视频 \n', '人民日报', 'http://m.weibo.cn/2803301701/4483847306015995', '2020-03-18 22:11:08');
INSERT INTO `news` VALUES ('315', '6小时前', '台湾新冠肺炎确诊病例破百', '【#台湾新冠肺炎确诊病例破百#】#台湾# #台湾疫情#据台湾“中央社”报道，台湾地区流行疫情指挥中心今（18）日公布，岛内新增23例新冠肺炎病例，再创单日新高，台湾地区累计确诊100例。台湾地区新增23例新冠肺炎确诊病例 累计100例 \n', '人民日报海外版', 'http://m.weibo.cn/3057540037/4483843380016996', '2020-03-18 22:11:08');
